		$parser->setFunctionHook( 'money', 'UbiGoHooks::money' );
		$parser->setFunctionHook( 'quellenlink', 'UbiGoHooks::quellenlink' );
		$parser->setFunctionHook( 'statistik', 'UbiGoHooks::statistik' );
		$parser->setFunctionHook( 'gemeinde', 'UbiGoHooks::gemeinde' );
		$parser->setFunctionHook( 'gemeindezahl', 'UbiGoHooks::gemeindezahl' );
		$parser->setFunctionHook( 'gkz', 'UbiGoHooks::gkz' );
		$parser->setFunctionHook( 'einzelticketpreissegment', 'UbiGoHooks::einzelticketpreissegment' );
		$parser->setHook( 'newsletter', 'UbiGoHooks::newsletter' );
		return true;
	}


	/**
	 * Newsletter-Formular
	 */
