	/**
	 * Module laden
	 */
	static function onBeforePageDisplay( OutputPage &$out, Skin &$skin ) {
		$out->addModules( 'ext.ubigo' );
	}
		
 
 	/**
	 * Nächstgelegene Bedarfsverkehre anzeigen
	 */
	static function nearestRender( $input, array $args, Parser $parser, PPFrame $frame ) {
		$parser->getOutput()->addModules( 'ext.nearest' );
		return '<div id="nearestBV"></div>';
	}


	/**
	 * Gemeinde zu einer GKZ ermitteln
	 *
	 * @param Parser $parser
	 * @param String $gkz GKZ
	 *
	 * @return String Gemeindename
	 */
	static function gemeinde( $parser, $gkz ) {
		return isset( self::$gemeinden[$gkz] ) ? self::$gemeinden[$gkz] : false;
	}


	/**
	 * GKZ zu einem Gemeindenamen ermitteln
	 *
	 * @param Parser $parser
	 * @param String $gemeinde
	 *
	 * @return String GKZ
	 */
	static function gkz( $parser, $gemeinde ) {
		return array_search( $gemeinde, self::$gemeinden );
	}

	/**
	 * Anzahl der Gemeinden ermitteln
	 *
	 * @param Parser $parser
	 * @param String $gemeindeliste Kommagetrennte Liste von Gemeinden
	 * 
	 * @return Integer Anzahl der Gemeinden
	 */
	static function gemeindezahl( $parser, $gemeindeliste ) {
		return count( explode( ',', $gemeindeliste ) );
	}


	/** 
	 * Preissegment zurückgeben
	 *
	 * @param Parser $parser
	 * @param Float $einzelticket
	 * 
	 * @return Integer Preissegment (nächsthöhere Ganzzahl)
	 */
	static function einzelticketpreissegment( $parser, $einzelticket ) {
		return ceil( $einzelticket );
	}


	/**
	 * Zahl als Währung ausgeben
	 *
	 * @param Parser $parser
	 * @param Float $betrag
	 * 
	 * @return String formatierter Währungsbetrag
	 */
	static function money( $parser, $betrag ) {
		setlocale(LC_MONETARY, 'de_DE');
		$betrag = '€ ' . money_format( '%!n', $betrag );
		return $betrag;
	}

	/**
	 * Kontoinformationen für UbiGo-Mitglieder ausgeben
	 *
	 * @param Parser $parser
	 * @param String $mitglied Benutzername
	 * @param String $konto Konto (Arbeitszeit oder Verrechnung)
	 * @param String $datum Datum des Stichtags für die Berechnung
	 *
	 * @return Float Kontostand
	 */
	static function konto( $parser, $mitglied = NULL, $konto = NULL, $datum = NULL ) {
		if( !is_null( $datum ) ) {
			$datum = new DateTime( $datum );
		} else {
			$datum = new DateTime( 'now' );
		}
		$conditions = '[[Kategorie:Arbeitszeit || Verrechnung]]';
		if( ! is_null( $konto ) ) {
			$conditions = '[[Kategorie:' . $konto . ']]';
		}
		if( ! is_null( $mitglied ) && $mitglied != '') {
			$conditions .= '[[Teammitglied::Benutzer:' . $mitglied . ']]';
		}
		$query = '{{#ask:' . $conditions . '|?Betrag#|?Datum#ISO|mainlabel=-|limit=10000|format=array|link=none|headers=plain|headersep==|sep=<Buchung>}}'; 
		$buchungen = $parser->recursiveTagParse( $query );

		if( $buchungen == "" ) {
			return 0;
		}

	    $buchungen = explode( '&lt;Buchung&gt;', $buchungen );
		$betrag = 0;

	    foreach( $buchungen as $key => $props ) {
	    	$props = explode( '&lt;PROP&gt;', $props );
	    	$buchungen[$key] = Array();
	    	foreach( $props as $prop ) {
	    		$prop = explode( '=', $prop );
	    		$buchungen[$key][$prop[0]] = $prop[1];
	   		}
		}
		foreach( $buchungen as &$buchung ) {
			$buchungsdatum = new DateTime( $buchung['Datum'] );
			$zeitdifferenz = $buchungsdatum->diff( $datum );
			$buchung['Zeitdifferenz'] = $zeitdifferenz->y;
			$buchung['Zinsbetrag'] = $buchung['Betrag'] * pow( 1.04, $zeitdifferenz->days/365 );
			$betrag += $buchung['Zinsbetrag'];
		}
		$betrag = round( $betrag, 2 );
		
		return $betrag;
	}
	

	/**
	 * Klasse zur Unterscheidung der Subseiten hinzufügen
	 *
	 * @param Skin $skinTweeki
	 * @param Array $additionalBodyClasses
	 */
	static function siteBodyClasses( $skinTweeki, &$additionalBodyClasses ) {
		$additionalBodyClasses[] = 'site-' . $GLOBALS['wgSitename'];
		return true;
	}
	

	/**
	 * Quelle als Link zurückgeben (falls es sich um Link handelt)
	 *
	 * @param Parser $parser
	 * @param String $quelle
	 *
	 * @return String Link oder Text
	 */
	static function quellenlink( $parser, $quelle ) {
		if( strpos( $quelle, 'http' ) === 0 ) {
			$quelle = '[' . $quelle . ']';
		}
		return $quelle;
	}


	/**
	 * Statistik ausgeben
	 *
	 * @param Parser $parser
	 * 
	 * @return String statistische Informationen
	 */
	static function statistik( $parser ) {
		$html = '';
		$title = $parser->getTitle();		

		$statistik = $parser->recursiveTagParse( '{{#ask:[[StatistikFür::' . $title->getText() . ']]
			|pagetitle=hide
			|?Jahr
			|?StatistikVariable
			|?StatistikWert
			|?Quelle
			|format=array
			|link=none
			|propsep=§
			|sep=°
		}}');

		$statistik = explode( '°', $statistik );
		$aktuell = [];

		if( $statistik[0] === '' ) {
			return '';
		}

		foreach( $statistik as $eintrag ) {
			$eintrag = explode( '§', $eintrag );
			$jahr = $eintrag[0];
			$variable = $eintrag[1];
			if( !isset( $aktuell[$variable] ) || $aktuell[$variable][0] < $jahr ) {
				$aktuell[$variable] = $eintrag;
			}
		}
		foreach( $aktuell as $variable => $eintrag ) {
			$jahr = $eintrag[0];
			$wert = $eintrag[2];
			$quelle = $eintrag[3];
		}
		$ausgabe = [
			[
				'variable' => 'Einwohner',
				'unit' => 'EinwohnerInnen',
				'attribut' => 'Einwohnerzahl',
			]
		];
		foreach( $ausgabe as $zeile ) {	
			$variable = $zeile['variable'];
			if( isset( $aktuell[$variable] ) ) {
				$eintrag = $aktuell[$variable];
				$jahr = $eintrag[0];
				$wert = $eintrag[2];
				$quelle = $eintrag[3];
				$html .= '<div>' . $variable . ' (' . $jahr . '): ' . $wert . ( isset( $zeile['unit'] ) ? ' ' . $zeile['unit'] : '' ) . ' <span class="statistikquelle">Quelle: ' . $quelle . '</span></div>';
				if( isset( $zeile['attribut'] ) ) {
					$html .= '[[' . $zeile['attribut'] . '::' . $wert . '|]]';
				}
			}
		}
		return $html;
	}

